import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import Logo from '../pictures/Logo.png';

function Header() {
  return (
    <div className="container-fluid" style={{ backgroundColor: '#3d3c3c' }}>
      <div className="row align-items-center">
        <nav className="navbar navbar-expand-lg navbar-light">
          <div className="col-sm d-flex align-items-center ps-5">
            <img src={Logo} className="d-inline-block align-top" alt="" style={{ height: '10%', width: '10%' }} />
          </div>
          <div className="col-sm-3 d-flex justify-content-end pe-2">
            <button type="button" className="btn me-3" style={{ backgroundColor: '#E0F0DC' }}>Sign In</button>
            <button type="button" className="btn btn-dark">Sign Up</button>
          </div>
        </nav>
      </div>
    </div>
  );
}

export default Header;
